import React from "react";
import "./index.css";
import { useNavigate } from "react-router-dom";

function Weather() {
  const navigate = useNavigate();
  const goBack = () => {
    navigate("/");
  };

  return (
    <div className="weatherApp">
      <div className="weatherContainer">
        <div className="top">
          <div className="location">
            <p>Toronto</p>
          </div>
          <div className="temo">
            <h1>68F</h1>
          </div>
          <div className="dsec">
            <p>Cloudy</p>
          </div>
        </div>
        <div className="feels">
          <p>65F</p>
        </div>
        <div className="humidity">
          <p>20%</p>
        </div>
        <div className="wind">
          <p>12mph</p>
        </div>
      </div>
    </div>
  );
}

export default Weather;
